- input: "TEXT\x1CC00459065\x1C.TEXT\x1C\x1CF3XA\x1CThe Treasurer of the Stinson Morrison
    Hecker Political Action Committee (PAC), Phillip Fraas, has provided exempt legal
    and accounting services during the first half of 2013, and the PAC is hereby reporting
    the receipt of these services, as provided for in 11 C.F.R. 104.3(h). Following
    is a description of the value of the time spent in providing the services. Mr.
    Fraas's employer, Stinson Morrison Hecker, pays for Mr. Fraas primarily based
    on his receipt of payments from clients for his provision of legal services to
    them. Since the services being reported here are provided 'gratis' to the PAC,
    and since the firm is not paying directly or providing those services, the value
    of this exempt legal and accounting services for the purpose of the report can't
    be determined by billings or collection on the hours worked in providing those
    services. However, Mr. Fraas recorded an estimated 1,000 hours of work in the
    first half of 2011 for which he was paid $90,000 by the firm. And he spnt 13 of
    those hours providing the exempt legal and accounting services. The percentage
    of total hours spent on the exempt services comes to approximately1.3%, and 1.3%
    of $90,000 is $1,170. Thus, Mr. Fraas values his exempt services during the first
    half of the year at $1,170.\n"
